<p><hi rend="bold">شىئەن شەھىرى</hi> بولسا <ref target="https://ug.wikipedia.org/wiki/جۇڭگو">جۇڭگو</ref> <ref target="https://ug.wikipedia.org/wiki/شېنشى_ئۆلكىسى">شېنشى ئۆلكىسى</ref> دىكىبىخاھار 2000 نوپۇس بار، شىئەننىڭ 8،252،000 نوپۇسىبار، 826.6 كم² دائىرائىقىدا نوپۇس جايلاخكان، خىمالىكاڭ لىك 34.16°، خارىكى ئۇزۇنلۇك 108°54، پوقتانومۇرى 710000 - 710090 رايۇننومۇرى +86/29.</p>
